import React from "react";

const Myheader = () => {
  return (
    <div className="container">
      <div className="row">
        <div class="col-4">
          <div className="card border-0 shadow-lg">
            <div className="card-header bg-primary text-white">
              Profile Setting
            </div>
            <div className="card-body">
              <div>
                <ul>Personal Details</ul>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Myheader;
